{'links': [], 'post_id': '1469012403479331142_4073479', 'hashtags': 'YouthArtMonth', 'caption': "In honor of #YouthArtMonth, the writer (and self-proclaimed @Zayn scholar) @fariha_roisin will be pairing young artists together for powerful conversations about their crafts, representation, inspiration, and creativity. For the first installment, she paired @yumnaa with @ohareeba â two artists who have redefined how Islam intersects with their art. Below is a sample of their conversation, hit the link in bio ðfor more. 
AS: Something I realized is that we are different sides of the same coin. Two young Muslim women â one of them draws covered women, and the other takes photographs of naked women. We're two opposite forces sharing the same religion. It adds another dimension to the Muslim woman image. What kind of reactions do you get for your work when people get to know about your religion?

YAA: Yes! We are so different! But I love it! It is so important for the rest of the world to see! I believe so many non-Muslims immediately think of a Muslim woman as one strict identity, which puts more oppression on us. Most people have a strong reaction to my background after seeing my work. People think my family disowned me and doesnât know about my work or what I do. But, on the contrary, my family loves me, loves my work, and they are proud of it. Theyâre some of the biggest supporters and fans of mine, as most families try to be for any one of their members.", 'comment_count': 109, 'like_count': 10768, 'link': 'https://www.instagram.com/p/BRi-v9wB0FG/', 'filter_name': 'Normal', 'image_url': 'https://scontent.cdninstagram.com/t51.2885-15/s640x640/sh0.08/e35/17125414_1324601184253317_4764835455462014976_n.jpg'}

{'links': [], 'post_id': '1252424008993235309_4073479', 'hashtags': 'GirlGaze', 'caption': 'Magdalena Wosinskaâs (@themagdalenaexperience) love of photography was born from another of her favorite childhood hobbies. âI started shooting skate photos when I was 14,â the Polish-born photographer says. âI was a total tomboy and grew up skating so I just started shooting photos of my surroundings.â Now known for her (often nude) self-portraits, Magdalenaâs photos capture the gorgeous travel locations that inspire her work. And like her photography, thereâs more to the L.A.-based artist, who describes herself and her work as passionate, fast, and direct, than meets the eye. âIâm super domestic and a fragile flower wrapped up in a leather jacket, blasting metal,â she reveals.

To Magdalena, #GirlGaze is, simply, âHow I view the world.â She shares that view by making sure that her camera never leaves her side â and thatâs the wisdom she hopes to impart on young aspiring photographers. âAlways have a camera with you,â Magdalena says. âAnd if you think you should stop and take a picture, then STOP and take the picture.â - Words by @hannamariehoward 
